drop table if exists usr_drug_details;
create table usr_drug_details (
	drug_Name VARCHAR(500),
	drug_Com VARCHAR(500),
	drug_Name_Gen blob,
	created_date VARCHAR(5000),
	short_hex VARCHAR(50),
	url blob,
	timezone VARCHAR(5000),
	created_time VARCHAR(50),
	hex_color VARCHAR(50),
	duns VARCHAR(50)
);
